_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1202507","type":"CustomJS"},{"attributes":{"factors":["0","1"],"palette":["rgb(178.5, 27.163043478260846, 0.0)","rgb(0.0, 178.5, 0.0)"]},"id":"1202122","type":"CategoricalColorMapper"},{"attributes":{},"id":"1202435","type":"ResetTool"},{"attributes":{"line_alpha":{"value":0.2},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"1202383","type":"Segment"},{"attributes":{"active_drag":{"id":"1202142"},"active_scroll":{"id":"1202143"},"tools":[{"id":"1202142"},{"id":"1202143"},{"id":"1202144"},{"id":"1202145"},{"id":"1202146"},{"id":"1202147"},{"id":"1202148"},{"id":"1202171"},{"id":"1202508"}]},"id":"1202150","type":"Toolbar"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwP45rkMHCRPA/g9Q9WCW97z+qyNrDO0DwPy+GGlhaPPA/N66CRtcW8D+D1D1YJb3vP129kGrtmO8/46nyPkgW7z9jkuEeqlXvP/10QkR/w+4/U6BVwiij7j+z6KPolnjvP3vb96nkY+8/yzG6c9GG7z++VKYuVsHvP2hjX0jEge8/plXCBAaR7z8nSmtYfyfvP9bpH39Lku8/XFgWhxUA7z8nV9wvi9/uP12vFHl+p+4/t4uU3bjb7j+RqHsUmrruP/e8RkJHge4/OwnQZsGa7j+MjaRUrkbuP9UWAjCKdO4/wIYL8MlZ7j83z6GkcYzuPw/+xE+D/O4/+8t
